'use strict';
let GetLeverageProfilesMessage = require('./GetLeverageProfilesMessage.js');
class GetLeverageProfilesMessageBuilder extends GetLeverageProfilesMessage {
    addLeverageProfile(leverageProfile) {
        this.leverageProfilesList.add(leverageProfile);
    }
    addLeverageProfiles(leverageProfiles) {
        let i;
        if (leverageProfiles != null) {
            for (i = 0; i <= leverageProfiles.length() - 1; i += 1) {
                this.addLeverageProfile(leverageProfiles.get(i));
            }
        }
    }
    setAccountId(accountId) {
        this.accountId = accountId;
    }
    build() {
        return this;
    }
}
module.exports = GetLeverageProfilesMessageBuilder
